const response = await fetch('https://dummyjson.com/users/');
let data = await response.json();
                                              //let dataParsed = JSON.parse(data);
                                              // .then(res => res.json())
                                              // .then(console.log);

console.log(data.users);
                                              //document.getElementById('name').innerHTML = name;
let name = data.firstName;


const Table = () => {
    return (
    <div className="mainTable">
      <table>
        <tbody>
          <tr>
              <th>ФИО</th>
              <th>Возраст</th>
              <th>Пол</th>
              <th>Номер телефона</th>
              <th>Город проживания</th>
              <th>Улица проживания</th>
          </tr>
          <tr>
              <td>Петров И.И.</td>
              <td>18</td>
              <td>М</td>
              <td>89999999999</td>
              <td>Казань</td>
              <td>Лулумбы</td>
          </tr>
          <tr>
            <td><span id="name">{name}</span></td>
          </tr>
        </tbody>
      </table>
    </div>
    );
  }

document.querySelector('.mainTable').innerHTML = `<table class="info"></table>`
for (key in data.users){
  let row = document.createElement('tr')
  row.innerHTML = `<td colspan="2">${key}</td>`
  document.querySelector('.firstName').appendChild(row)
};


export default Table;
